import React from "react";
import './App.css';
import Myroute from "./components/myroute";
import Mynavigation from "./components/mynavigation";
import {HashRouter} from "react-router-dom";


function App() {
    return (
        <div>
            <HashRouter>
                <Mynavigation/>
                <Myroute/>
            </HashRouter>

        </div>
    )
        ;
}

export default App;
